import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom'; // Use named imports for BrowserRouter and Route
import MarkDown from './components/MarkDown';
import MarkDownWithServer from './components/MarkDownWithServer';
import ConversionSelector from './components/ConversionSelector';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact component={ConversionSelector} />
        <Route path="/client" component={MarkDown} />
        <Route path="/server" component={MarkDownWithServer} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
